import axios from "axios";
import "./Products.css";
import Header from "../components/Header.js";
import Footer from "../components/Footer.js";
// import { Link } from "react-router-dom";

function Products() {

    const [products, setProducts] = useState([])

    useEffect(() => {

        const fetchAllProducts = async () => {

            try {
                const res = await axios.get("http://localhost:8000/products")


                setProducts(res.data);
                // console.log(res.data);

            } catch (err) {
                console.log(err)
            }

        }

        fetchAllProducts();

    })

    return (
        <div>

            <Header />

            {/* HERO SECTION */}
            <section id="heroSection">

                <div className="heroContainer">

                    <p className="heroText">Explore our world of audio</p>

                </div>

                {/* In-Page navigation bar  */}
                <div>
                    {/* <ul className="productsInnerNav">
                        <li className="InnerNav-item"><a href="#proAudioSection" style="text-decoration: none;">Pro Audio</a></li>
                        <li className="InnerNav-item"><a href="#homeAudioSection" style="text-decoration: none;">Home Audio</a></li>
                    </ul> */}
                </div>

            </section>

            {/* <div className='products'>
                {products.map((product) => (
                    <div className='book' key={product.ID}>


                        <p>{product.productTitle}</p>
                        <p>{product.productDescription}</p>
                        <p>${product.productPrice} USD</p>

                    </div>
                ))}
            </div> */}


            <div className='products'>
                {products.slice(0, 5).map((product) => (
                    <div className='book' key={product.ID}>


                        <p>{product.productTitle}</p>
                        <p>{product.productDescription}</p>
                        <p>${product.productPrice} USD</p>

                    </div>

                ))}
            </div>

            <div className='products'>
                {products.slice(5, 13).map((product) => (
                    <div className='book' key={product.ID}>


                        <p>{product.productTitle}</p>
                        <p>{product.productDescription}</p>
                        <p>${product.productPrice} USD</p>

                    </div>

                ))}
            </div>

            {/* <button><Link to="/add">Add new book</Link></button> */}

            <Footer />
        </div>
    )
}

export default Products
